import "./Footer.scss";
import github from "../../assets/images/github-black.svg";
import linkedin from "../../assets/images/linkedin-black.svg";
import instagram from "../../assets/images/instagram-black.svg";
import twitter from "../../assets/images/twitter-black.svg";
import { Link } from "react-router-dom";

function Footer() {
  return (
    <>
      <section className="footer">
        <h2 className="footer__brand">Sproutr</h2>

        <div class="footer__contentbox">
          <h3 className="footer__title">Contact Us</h3>
          <p>504 Habitualr Way.</p>
          <p>Toronto, ON M6J 2Y6, Canada</p>
        </div>

        <a className="footer__email" href="mailto:info@sproutrinc.com">
          info@sproutrinc.com
        </a>

        <div className="footer__social">
          <img
            className="footer__handle"
            src={instagram}
            alt="instagram icon"
          />
          <img className="footer__handle" src={linkedin} alt="linkedin icon" />
          <img className="footer__handle" src={github} alt="github icon" />
          <img className="footer__handle" src={twitter} alt="twitter icon" />
        </div>

        <div className="footer__acknowledgements">
          <span className="footer__copyright">
            All Content Â© Sproutr Inc. 2022 All Rights Reserved.
          </span>

          <span>Terms of Service</span>

          <span>Accessibility</span>
        </div>
      </section>
    </>
  );
}

export default Footer;
